import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          TKC Class Schedule: First Class Scheduler
        </p>
        <Grid
          container
          direction="column"
          justify="flex-start"
          alignItems="center"
        />
      </header>
    </div>
  );
}

export default App;
